import styled from "styled-components";

export const Button = styled.button`
  padding: 18px;
  background-color: ${({ theme }) => theme.colors.brandColorPrimary};
  color: ${({ theme }) => theme.colors.white};

  border: 0;
  border-radius: 32px;
`;
